import React,{Component} from 'react';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state={
      abc:[]
    }
  }
  componentDidMount(){
    fetch('/data')
    .then(res => res.json())
    .then(abc=>this.setState({abc},()=> console.log("adasd",abc)));
  }
  render(){
  return (
      <div>
          {this.state.abc[0].map(abc =>
              <li key={abc.CompanyID}> {abc.Name}</li>
            )}
      </div>
  );
}}

export default App;
